import './App.css';
import React, { useState } from 'react';
import styled from 'styled-components';
function App() {
	const Title = styled.h1`
		font-size: 2.5em;
		text-align: center;
		color: #000;
	`;

	// background-color: lightseagreen;
	const Wrapper = styled.section`
		color: white;
		position: relative;
		text-align: center;
	`;
	const Container = styled.div`
		color: white;
		position: relative;
		text-align: center;
	`;
	return (
		<div className='App'>
			<Wrapper>
				<Title>Luz</Title>
				<Container></Container>
			</Wrapper>
			{/* <div className='contenedor'>
				<div class='circleBase type1'></div>
			</div> */}
		</div>
	);
}

export default App;
